import React, {Component} from 'react';
import Particles from 'react-particles-js';

function Page(){
	return(
		<div>
			<Particles 
	              params={{
	            		particles: {
	            			line_linked: {
	            				shadow: {
	            					enable: true,
	            					color: "#3CA9D1",
	            					blur: 5
	            				}
	            			}
	            		}
	            	}}
	              style={{
	                width: '100%',
	                backgroundImage: `url(${logo})` 
	              }}
	        />
	    </div>
	)
}

export default Page;
